import { Container } from "react-bootstrap";
import FoodSearch from "./FoodSearch";
import { Col, Row } from 'react-bootstrap';

function CustomToggle(props) {
    return (

        <Container fluid>
                <Row>
                    <Col sm='4'>
                    <FoodSearch/>
                    </Col>
                </Row>
        </Container>
    );
}

export default CustomToggle;
